import React, { Fragment } from "react";
import { connect } from "react-redux";
import { Redirect } from "react-router-dom";
import ClientCard from "../employee/ClientCard";

const EmployeeDashBoard = ({ employee: { employee } }) => {
  if (!employee) {
    return <Redirect to="/employee-login" />;
  }
  return (
    <Fragment>
      <h3>Your Clients</h3>
      {employee.customers
        ? employee.customers.map((customer) => (
            <ClientCard key={customer.identifier} customer={customer} />
          ))
        : null}
    </Fragment>
  );
};

const mapStateToProps = (state) => ({
  employee: state.employee,
});

export default connect(mapStateToProps)(EmployeeDashBoard);
